window.bookSummaryJSON = "<p>Siouca is a member of the advanced Wanderer civilization. What does Siouca want?</p> <p>The quest to unlock the secrets of interstellar travel leads a Roranian crew on an epic journey across space. Saved by a dying machine-lect, stranded in a failing ship, faced with an ultimate choice. Were they too eager in their attempts to reach the stars?</p> <p>The fractious Primals are the ancient, all-powerful rulers of the Creatites. Their origins are shrouded in mystery although Storytellers recite their legends. Tallic has recently been granted special abilities by the Barrier Primal that most other Creatites could only dream of, although he has an unexpected encounter with an intruder that changes everything.</p> <p>What secrets have the Primals kept hidden since time began?</p> <p>Nurilm resides within a decaying temple. One day, she chances upon forbidden knowledge about an enigmatic entity called the \"Collector\" and an unthinkable battle waged long ago in which the Primals were united.</p> <p>What does it all mean? And how is it all connected?</p> <p>One thing is for certain. Siouca is coming.</p> <p>A stand-alone novel from the Wanderer universe.</p> <p>Cerebral sci-fi with an emphasis on the \"sci\". If you enjoy hard sci-fi, complex space opera, and authors such as Iain M. Banks, Alastair Reynolds, and Dan Simmons, then this is for you.</p>"; 
